StandartDeviation\":{\"value\":5.1797566,\"formatted\":\"5.18\"},\"seasonConsistency\":\"RATING_GOOD\"},{\"proPlayer\":{\"id\":14712,\"nameFull\":\"Damien Harris\",\"nameShort\":\"D. Harris\",\"proTeamAbbreviation\":\"NE\",\"position\":\"RB\",\"headshotUrl\":\"https://d26bvpybnxg29h.cloudfront.net/nfl/14712.png\",\"injury\":{\"typeAbbreviaition\":\"Q\",\"description\":\"Ankle\",\"severity\":\"QUESTIONABLE\",\"typeFull\":\"Questionable\"},\"news\":[{\"timeEpochMilli\":\"1605741865000\",\"contents\":\"Harris (chest/ankle) was a limited participant in Wednesday's practice, Mike Reiss of ESPN.com reports.\",\"analysis\":\"Harris was limited at practice last week, before rushing 22 times for 121 yards in the Patriots' Week 10 win over the Ravens. With no reported setbacks in that contest, we suspect that his Wednesday limitations were maintenance-related. It remains to be seen if Sony Michel (quadriceps) comes off injured reserve ahead of this Sunday's game against the Texans, but the way Harris has been running of late, it seems likely that he'll continue to head New England's ground game in the coming weeks, in any case. Harris' limited involvement in the team's passing game means that his fantasy utility going forward hinges on him seeing double-digit carries weekly and making the occasional trip to the end zone.\",\"title\":\"Logs limited practice\"},{\"timeEpochMilli\":\"1605575792000\",\"contents\":\"New England Patriots running back Damien Harris was fantastic on the ground versus the Baltimore Ravens in Week 10. He rushed 22 times for 121 yards in the win over the Ravens. Both the yards and carries were a season high for Harris. Sony Michel (quad) is expected to suit up next week, but Harris should remain the lead back. It'd be surprising to see Harris lose the starting role against the Houston Texans next week. Although, his fantasy value could take a small hit.\",\"url\":\"https://www.rotoballer.com/player-news/damien-harris-dominates-on-the-ground-in-week-10/804876\",\"title\":\"Damien Harris Dominates On The Ground In Week 10\"}],\"nameFirst\":\"Damien\",\"nameLast\":\"Harris\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"externalIds\":[{\"id\":\"59482736-ce42-4058-b68e-0f9f66eac2d9\"}],\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6300,\"away\":{\"abbreviation\":\"NE\",\"location\":\"New England\",\"name\":\"Patriots\"},\"home\":{\"abbreviation\":\"HOU\",\"location\":\"Houston\",\"name\":\"Texans\"},\"startTimeEpochMilli\":\"1606068000000\",\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true}},\"stats\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\"nameSingular\":\"Rushing Yard\",\"namePlural\":\"Rushing Yards\"}},{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",\"namePlural\":\"Offensive + Special Teams TDs\"}}],\"statsProjected\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\"nameSingular\":\"Rushing Yard\",\"namePlural\":\"Rushing Yards\"},\"value\":{\"value\":70.73,\"formatted\":\"70.7\"}},{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"formatted\":\"0/0\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"},\"value\":{\"value\":5.19,\"formatted\":\"5.2\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",\"namePlural\":\"Offensive + Special Teams TDs\"},\"value\":{\"value\":0.54,\"formatted\":\"0.5\"}}],\"pointsProjected\":{\"value\":11.120001,\"formatted\":\"11.12\"},\"period